import React, { Component } from 'react'
import Search from './Search';
import Welcome from './Welcome';
import Message from './Message';
export class Home extends Component {
    render() {
        return (
            <div>
                <Welcome 
                  user={this.props.getActiveUser} 
                  currentHour={this.props.getCurrentHour}
                />
                <Search/>
                <Message 
                  user={this.props.getActiveUser} 
                  currentDay={this.props.getCurrentDay} 
                  currentMonth={this.props.getCurrentMonth}
                />
            </div>
        )
    }
}

export default Home
